import { useContext } from "react";
import { Table } from "reactstrap";
import { DivHeaderTable, Tr, Th } from "./style";
import { Context } from "../../hooks/DataProvider";

const Tables = () => {
  const { file, setFile } = useContext(Context);

  const data = file.data;

  function toObject(arr) {
    var rv = {};
    for (var i = 0; i < arr.length; ++i) rv[i] = arr[i];
    return rv;
  }

  function subString(string, number) {
    let result;
    if (string.length > number) {
      result = string.substring(0, number - 1) + "...";
    }
    return result;
  }

  return (
    <>
      <DivHeaderTable>
        <div className="child-1">38</div>
        <div className="child-2">
          listings successfully and Ready to published
        </div>
        <div className="child-3">
          <i className="fas fa-history"></i> Update data
        </div>
        <div className="child-4">
          <i className="far fa-window-maximize" />
        </div>
        <div className="child-5">Published</div>
      </DivHeaderTable>
      <Table responsive>
        <thead>
          <tr>
            <th></th>
            <th>CONDO NAME</th>
            <th>RENT PRICE (Baht)</th>
            <th>SELL PRICE (Baht)</th>
            <th>BEDROOM</th>
            <th>BATHROOM</th>
            <th>SIZE (sqm.)</th>
            <th>FLOOR </th>
            <th>STATUS </th>
            <th>PHOTO </th>
            <th>TITLE </th>
            <th>DESCRIPTION </th>
            <th>BENEFIT </th>
            <th>Amenities </th>
          </tr>
        </thead>
        <tbody>
          {data.map((file, index) => {
            const object = { ...file };
            let id = object["0"];
            let name = subString(object["1"], 20);
            let rate_price = object["2"];
            let sale_price = object["3"];
            let title = subString(object["8"], 20);
            let description = subString(object["9"], 20);
            let photo = object["10"];
            if (index > 0) {
              return (
                <>
                  <Tr>
                    <Th scope="row">{id}</Th>
                    <Th>{name}</Th>
                    <Th>{rate_price}</Th>
                    <Th>{sale_price}</Th>
                    <Th>{object["4"]}</Th>
                    <Th>{object["5"]}</Th>
                    <Th>{object["6"]}</Th>
                    <Th>{object["7"]}</Th>
                    <Th>{title}</Th>
                    <Th>
                      <img src={`${photo}`} width={"50%"} />
                    </Th>
                    <Th>{description}</Th>

                    <Th>{object["11"]}</Th>
                    <Th>{object["12"]}</Th>
                    <Th>{object["13"]}</Th>
                  </Tr>
                </>
              );
            }
          })}
        </tbody>
      </Table>
    </>
  );
};

export default Tables;
